import { Link } from 'react-router-dom'

const Main = () => {
    return (
        <div>
            <h1>홈</h1>
            <p>메인 페이지입니다.</p>
            <Link to ="/aboutus">소개</Link>
            <br/>
            <Link to ="">택우</Link>
            <Link to ="">진솔</Link>
            <Link to ="">재명</Link>
            <Link to ="">민규</Link>
            <Link to ="">우진</Link>
            <Link to ="">연주</Link>
            <Link to ="">예지</Link>
            <Link to ="">정원</Link>
            <Link to ="">수원</Link>
            <Link to ="">태원</Link>
            

        </div>
        
    );
};

export default Main;
